/* 

Context: On joining Empower, Shea attempted to resubscribe to Empower but failed due to Fraud checks on a non-primary bank account he linked, despite having another bank account linked with eligible CA offers. 

Goal: Understand how many users are attempting to resubscribe who:
1. Fail re-subscription due to fraud rules on their subscription account
2. Have another linked account that is different from their subscription account
3. Have eligible offers on that different account, indicating that we could monetize these users by switching subscription account in this flow

Findings:
Looking over a full week September 4, 2023 - September 18, 2023:
1. Of the 30,542 users that attempt to resubscribe, 5,547 (18.2%) are failing due to FRD
https://app.amplitude.com/analytics/empower/chart/xscck8g4/edit/nvqn3w41?source=copy+url
2. Of those 5.5k users, 4,992 (90%) have a CA monitoring account that is different from their Subscription account. 
3. Of those users with different CA monitoring accounts, 1,912 or 38.3* have eligible CA offers.

Main takeaway: A material amount of users are failing resubscription while having other eligible bank accounts that we do not let them switch to while resubscribing. This is a frustrating user experience and weâ€™re leaving money on the table.

Total opportunity would be an additional ~$15k subscription revenue per week.**
*/


---Looking up User IDs based on Amplitude public tokens and creating a temporary table for users who have different CA Monitoring and Subscription bank accounts.

drop table #reopen_frd_shea;
select 
u.userid,
    c.monitoringaccountid as CAMonitoringAccount,
    s.accountid as SubscriptionAccount
into #reopen_frd_shea 
from matillion.prod_user as u 
left join matillion.prod_usercashadvancesubscription as c
on u.UserId = c.UserId
left join matillion.prod_usersubscription as s
on u.UserId = s.UserId
