--- If a bank account has a CA offer against it is the proxy we'll use to determine a 'good' bank account. That data is stored in a table that does not have userid so we'll need to join based on usercreditvariables in a beryllium table. The below creates a table on those offers, orders by most recent, and then joins with the userids in the above. We show the breakdown of offers eligible for that population

---drop table #cs_userid_mesh ;
select 
a.*, 
cv.actualanalysisdateutc,
cv.usercreditvariableid,
ce.amounteligible,
row_number () over (partition by a.UserId order by actualanalysisdateutc desc) as row_num_v2
into #cs_userid_mesh 
from #reopen_frd_shea a
left JOIN matillion.prod_usercreditvariableberyllium as cv
on a.userid = cv.userid 
and cv.actualanalysisdateutc >= '2023-09-01'
left join matillion.prod_usercashadvanceeligibility as ce
on cv.usercreditvariableid = ce.usercreditvariableid


select 
amounteligible,
count(distinct userid)
from #cs_userid_mesh 
where row_num_v2 =1 
group by amounteligible;







